import React from "react";
import Cards from "./Cards";

import img1 from "./images/img1.jpeg";
import img2 from "./images/img2.jpeg";
import img3 from "./images/img3.jpeg";
import img4 from "./images/img4.jpeg";
import img5 from "./images/img5.jpeg";
import img6 from "./images/img6.jpeg";
import img7 from "./images/img7.jpeg";
import img8 from "./images/img8.jpeg";
const img = [img1, img2, img3, img4, img5, img6, img7, img8];
const image1 = img[0];
const image2 = img[1];
const image3 = img[2];
const image4 = img[3];
const image5 = img[4];
const image6 = img[5];
const image7 = img[6];
const image8 = img[7];
const Professional = () => {
    return (
        <main className="professionalPage">
            <h3 className="eventsHeading">
                Live Events<span className="designLine"></span>
            </h3>

            <div className="liveEvents">
                <Cards images={image1} />
                <Cards images={image2} />
                <Cards images={image3} />
                <Cards images={image4} />
            </div>
            <h3 className="eventsHeading">Upcoming Events</h3>
            <div className="upcomingEvents">
                <Cards images={image5} />
                <Cards images={image6} />
                <Cards images={image7} />
                <Cards images={image8} />
            </div>
            <h3 className="eventsHeading">Past Events</h3>
        </main>
    );
};

export default Professional;
